import React from 'react';
import { View, Text, StyleSheet, TextInput, Image } from 'react-native';
import Logo from './rocket.png';

const Login = () => {
	return (
	<View> 
		<Image source={require('./rocket.png')} />
	</View>
	);
}

const styles = StyleSheet.create({
	root: {
		flex: 1,
	},
	container: {
		flex: 1,
		backgroundColor: '#ffcfe6',
		justifyContent: 'space-evenly',
		alignItems: 'center',
	},
	tasksWrapper: {
		paddingTop: 80,
		paddingHorizontal: 40,
	},
	sectionTitle: {
		fontSize: 24,
		fontFamily: 'helvetica',
	},
	button: {
		width: 60,
		height: 60,
		backgroundColor: '#fff',
		borderRadius: 60,
		justifyContent: 'center',
		alignItems: 'center',
		borderColor: '#ffd500',
		borderWidth: 1,
	},
	input: {
		paddingVertical: 15,
		paddingHorizontal: 15,
		backgroundColor: '#fff',
		borderRadius: 60,
		borderColor: '#ffd500',
		borderWidth: 1,
		width: 250,
	},

});

export default Login
